function runShowNextReviews(){try{showNextReviews()}catch(n){console.error(n)}}function showNextReviews(){function e(){const n=Number(document.getElementById("currentNumber").textContent);n!=1&&$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${0}`,null,prepareNavigation)}function o(){const r=Number(document.getElementById("currentNumber").textContent),t=r-n;t>0&&$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${t-n}`,null,prepareNavigation)}function s(){const r=Number(document.getElementById("currentNumber").textContent);t-r-n+1>0&&$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${r}`,null,prepareNavigation)}function h(){if(!(t/n<1)){const r=Number(document.getElementById("currentNumber").textContent);if(t!=n+r-1){const u=t-n*2+1;$("#reviews-container").load(`/Reviews/GetNextReviews?teacherId=${i}&currentNumber=${u}`,null,prepareNavigation)}}}const n=4,r=document.getElementById("allRatingsCount");if(r!=null){const t=Number(r.textContent);document.getElementById("to-start").addEventListener("click",e);document.getElementById("previous").addEventListener("click",o);document.getElementById("next").addEventListener("click",s);document.getElementById("to-end").addEventListener("click",h);const u=window.location.search,f=new URLSearchParams(u),i=f.get("teacherId")}}window.addEventListener("DOMContentLoaded",runShowNextReviews);